contracts/voting.sol.content:
//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VotingContract{
    address[] voterList; //people those already voted
     address electionCommission;
     bool voteStarted = false;
    //custom data structure
    struct candidate{
        string name;
        string symbol;
        uint voteCount;
    }

    candidate[] Candidates; //list of candidate

    //setting authority
    constructor(){
        electionCommission = msg.sender;
    }
    //register for voter
     function registrationForCandidate  (string memory name, string memory symbol)public
     {
        require(msg.sender==electionCommission,"Unauthorized Acess");
        require(voteStarted==false,"Election already Started");
        require(bytes(name).length!=0,"Name Can't be empty");
        require(bytes(symbol).length!=0,"Symbol can't be empty");
        Candidates.push(candidate(name,symbol,0));
     }
     function startVote() public{
        require(msg.sender==electionCommission,"Only election officer can  start vote.");
        require(voteStarted==true,"Already Started");
        voteStarted = true;
     }

     



}

